import React from "react";

export class Head extends React.Component {
    static show() {
        console.log(1);
    }
}

function App() {
    return (
        <div className="App">
            123
        </div>
    );
}

export function Test (){

    return (<div className="alert alert-dismissible alert-warning">
        <button type="button" className="close" data-dismiss="alert">&times;</button>
        <h4 className="alert-heading">Warning!</h4>
        <p className="mb-0">Best check yo self, you're not looking too good. Nulla vitae elit libero, a pharetra augue.
            Praesent commodo cursus magna, <a href="#" className="alert-link">vel scelerisque nisl consectetur et</a>.
        </p>
    </div>)
}
//export default App;
